INSERT INTO `pages` (`id`, `slug`, `title`, `description`, `summery`, `file_path`, `uploaded_by`, `status`, `created_at`, `updated_at`) VALUES
(1, 'our-history', 'Our History', '<p>Chittagong port is the most prestigious organization of Bangladesh which adds to maximum contribution to national economy. Chittagong Port Women College is a successful implementation of a long cherished desire of the stake hollers of the port authority. Chittagong Port has started its institutional journey in 1887. After a long duration of about 68 years primary education of was introduced under the</p>\r\n<p>supervision of port authority. Secondary educational institution was added in 1965. The demand of establishing a college was voiced in various sectors for about half a century. Particularly class to the absence of female education center in this wide range of area it was very much trouble some and challenging for the female to continue study attending for reaching institution. So to build a knowledge based women folk with modern outlook several officials of the Port authority stepped ahead to establish a college.</p>\r\n<p>From June 2013 Chittagong Port College started its journey attached with Chittagong Port Girls High School. But within a short span of time the college was emerged as an individual institution aiming at spreading higher education for female in this area. The successful establishment of this college was implemented by the strong girl power and ceaseless efforts of the Honorable Ex Chairman Rear Admiral Nizam Uddin Ahmed (TAS) OSP, NDC, PSC, BN Ex/Chairman of CPA.</p>\r\n<p>At present the image of the college has reached its highest peak. Of admiration and reliance for the reciprocal and for the hole hearted devotion of the brilliant Teachers of the institution. Chittagong Port College boats of rich heritage and glorious success contributing to the augmentation of education. It is the pioneer college in the port area to spread the light of education among women.</p>\r\n<p>Chittagong Port Women College is enriched with all the facilities required for the students of the time. The college has rich laboratories with latest collection of apparatus. A digitalized library with rich collection of book and a rich computer lab with modern technologies are on the process. The college is staying at a peaceful environment completely free from racket and bustle of the nice sea the Bay of Bengal.</p>\r\n<p>To turn the college into an outstanding one we have developed the strategies as follows.</p>', 'Chattogram Bandar Mohila College is one of the welfare institutions run by Chittagong Port Authority, the main driving-force of the economy of Bangladesh. This college started its journey with a view to ensuring quality education enriched with modern information and technology. To build up skilled, proficient and morally upgraded citizens facing the challenge of the 21. <br/>\r\nStandard education is the per-requisite of a developed nation. ‘Quality education results well citizens’ – this slogan is the motto of this college since its establishment. This journey with the above aim will be continued to prepare enlightened individuals. We do believe that a positive change can be brought in the attitude of people through flourishing education. Consequently, educated nation must usher in. And no doubt, that educated nation will be the wheel of development. <br/>\r\nIn order to ensure higher studies for the children of the members of Chittagong Port Authority, Chittagong Port High School (established in 1959) has been graded to a School and College initially from 2013-2014 sessions. Lately, in January 2014, Chattogram Bandar Mohila College earned the recognition as a distinctive college to spread time-honored higher education.', 'assets/uploads/pages/1599472194.jpg', 1, 1, '2020-09-07 17:30:53', '2020-09-07 20:54:40'),
(2, 'chairman-message', 'Message from Honourable Chairman', '<p>Bangladesh has been moving towards with continuous development for the last two decades facing the increasing competition of this intensive competitive world begun from the 21st century. We already have joined the lower-middle income country category.<br /><br />Through the implementation of vision 2021 the country continues to express its aspiration to join the middle income country by 2021 and also by 2041, expecting herself as a developed country Chattogram Bandar Mohila College is working diligently to build up a skilled and meritorious human resources who are the crying need to achieve this goal.<br /><br />After a long tradition of a half decade period, we are now at the top list in various sectors in the region. The institute&rsquo;s commitment to the development of young students through the preservation of religious values spirit of the liberation war, science and technology and also by practicing sports, literature and culture into them.<br /><br />Chattogram Bandar Mohila College will move forward smoothly with the adaptation of a new idea of a day with tradition. As the Chairman Executive committee, I want creative thinking and cooperation from all including the students, the teacher and the guardians also.<br /><br /><strong><em>Rear Admiral M. Shahjahan ,</em><br />NPP, NDC,PSC,BN Chairman , Chittagong Port Authority.</strong></p>', 'Bangladesh has been moving towards with continuous development for the last two decades facing the increasing competition of this intensive competitive world begun from the 21st century. We already have joined the lower-middle income country category', 'assets/uploads/pages/1612689538.jpeg', 1, 1, NULL, '2021-02-10 17:38:36'),
(3, 'principal-message', 'Message from Principal', '<p>At the dawn of the creation, man intends to disclose himself to others. This trait of disclosure is man&rsquo;s instinctive quality. &ldquo;Chattogram Bandar Mohila College&rdquo; is contributing this gigantic task to fetch the hidden talent out of the tender hearted students taking part in co-educational process along with pragmatic timely academic education for the betterment of the Students to make themselves Glove citizen.<br /><br />This institution is playing a pioneer role to develop human resources upholding the actual scientific and technology based education method.<br /><br />It needs not telling that a team of young and meritorious teachers, students, guardians and Executive committee contribute relentlessly behind these great effort. I pray to the most merciful creator that let this popularity the institution has earned within a short time be continued by the whole hearted efforts of all day by day.<br /><br />In fine, I draw the help and attention of the concerned people to keep continuity of success of Chattogram Bandar Mohila College as a workshop of man maker. I do believe that we must be able to increase the fame of this institution along with the co-operation and heart rending service of all.<br /><br /><strong><em>Kashana Akhter Khanam</em><br />Principal of Chattogram Bandar Mohila College .</strong></p>', 'At the dawn of the creation, man intends to disclose himself to others. This trait of disclosure is man’s instinctive quality. “Chattogram Bandar Mohila College” is contributing this gigantic task to fetch the hidden talent out of the tender hearted students taking part in co-educational process along with pragmatic timely academic education for the betterment of the Students', 'assets/uploads/pages/1603010701.jpg', 1, 1, NULL, '2021-02-07 21:24:58'),
(4, 'mission-vision', 'Vision & Mission', '<p><strong>Vision </strong></p>\r\n<p class=\"justify\">The vision of the institution is to flourish it as a prestigious seas of learning . As a center for excellence it aims at faciliting students from every nook and corner .</p>\r\n<p><strong>Mission </strong></p>\r\n<p class=\"justify\">our mission is to provide alusrity education for the students at an affordable cost so that they can attain their full intellectual , social and individual potentialities by creative thinking .</p>\r\n<p><strong>Objective </strong></p>\r\n<p class=\"justify\">our objective is to build knowledge lased society by maintaining world class standard of education providing all the modern facilities .</p>\r\n<p><strong>Goal </strong></p>\r\n<p class=\"justify\">we are committed to develop women resources by cultivating sincerity , honesty, patriotism and moral values among the students to turn then them in to precious assists of the nation facing the Challenges of 1st century with vigour and zeal. To reach our goal and to keep pace with the modern stride we have got our attachment with the latest technologies of the time Wishing a great success of the institution .</p>', NULL, 'assets/images/default/featured.png', 1, 1, NULL, '2020-09-09 20:56:07'),
(5, 'achievements', 'Achievements', '<div class=\"rules_regulation justify\">\r\n<h4>Regarding Attendance</h4>\r\n<ul style=\"margin-left: 35px;\">\r\n<li>To attend the class regularly is a must.</li>\r\n<li>To leave the campus until before the time the class is thoroughly forbidden.</li>\r\n<li>To be present regularly in the college according to the routine from 9.00 am &ndash; 2.00 pm is obligatory.</li>\r\n<li>Absence without permission is not allowed.</li>\r\n<li>In case of emergency leave should be granted by the respective guide teacher through the guide the guardian&rsquo;s recommendation.</li>\r\n<li>After exam all the marked answer scripts are submitted to the Principal for observation.</li>\r\n<li>75% presence of total classes according to Chittagong Board must be fulfilled. 60%-75% presence will be considered non-collegiate and paying fine fixed by Chittagong Board, the students can attend the internal and board examination. Below 60% attendance is considered dis-collegiate and students are not allowed to take part in internal and Board examinations.</li>\r\n</ul>\r\n<hr />\r\n<h4>Rules and Disciplines</h4>\r\n<ul style=\"margin-left: 35px;\">\r\n<li>Wandering outside during class hour is thoroughly forbidden.</li>\r\n<li>Any sort of writing (relevant or irrelevant) or putting marks on the wall, classroom or anywhere in the college campus is strictly prohibited.</li>\r\n<li>Going outside during Tiffin hour or any time without permission is not allowed Homemade Tiffin is a must.</li>\r\n<li>No furniture or asset should be damaged</li>\r\n<li>Personal along with classroom or bathroom cleanliness must be maintained.</li>\r\n<li>Carrying the college ID card is a must.</li>\r\n<li>Using or carrying any sort of mobile phone in the college premise is totally prohibited .If emergency, the respective guide teachers.</li>\r\n<li>Any outsider or none but the real guardian is allowed in the college campus.</li>\r\n</ul>\r\n<hr />\r\n<h4>Uniform of the students</h4>\r\n<ul style=\"margin-left: 35px;\">\r\n<li>To wear the college Uniform is a must&rsquo;s strict action must be taken against the violators of the dress code.</li>\r\n</ul>\r\n<hr />\r\n<h4>College uniform</h4>\r\n<ul style=\"margin-left: 35px;\">\r\n<li>Sky-blue frock, white cross Oran, white scarf, sky-blue belt, white trousers, white socks and black Bata shoes are the Uniform. Navy-blue sweater is considered as winter season dress.</li>\r\n</ul>\r\n<hr />\r\n<h4>Tuition Fees</h4>\r\n<ul style=\"margin-left: 35px;\">\r\n<li>From the 1st to the 10st of every month the tuition fees should be paid. Otherwise, with delay fine, all the dues within the 10th of the next month can be paid.</li>\r\n</ul>\r\n<hr />\r\n<h4>Rule on Examination</h4>\r\n<p>To arrange the examination in order to justify the merits of the students and to continue the academic progress is very urgent. In addition, the importance of arranging examination lies in answering skillfully and methodically within the certain period of time .For this Chittagong port women College authority has recommended to arrange examination on the following particulars</p>\r\n<table class=\"table table-bordered\">\r\n<tbody>\r\n<tr>\r\n<th>SL</th>\r\n<th>Class</th>\r\n<th>Name of Examinations</th>\r\n</tr>\r\n<tr>\r\n<td>1</td>\r\n<td>XI</td>\r\n<td>At least 40 tutorials totaling to all subjects.</td>\r\n</tr>\r\n<tr>\r\n<td>2</td>\r\n<td>XI</td>\r\n<td>Half yearly and Final exams.</td>\r\n</tr>\r\n<tr>\r\n<td>3</td>\r\n<td>XII</td>\r\n<td>At least 25 Tutorials totaling to all subjects.</td>\r\n</tr>\r\n<tr>\r\n<td>4</td>\r\n<td>XII</td>\r\n<td>Pre-Test and Test Examinations according to the direction of the Board.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>It is a must to participate in all the internal examinations of the college .No consideration can be shown except for the participation in the Examinations.</p>\r\n<hr />\r\n<h4>Result of the Examinations</h4>\r\n<ul style=\"margin-left: 35px;\">\r\n<li>20% Tutorial marks will be added to the score/marks of respective subject in the terminal examination and thus with the average marks of each Subject, examination result will be prepared.</li>\r\n</ul>\r\n<hr />\r\n<h4>Promotion/Selection for the Board examination</h4>\r\n<ul style=\"margin-left: 35px;\">\r\n<li>Average passed mark is 40%.</li>\r\n<li>Only those who pass in all subjects in are promoted to the 2nd year.</li>\r\n<li>Those who pass in all subjects in the Test Examination will be selected for the Board Examination.</li>\r\n<li>Failure in maximum two subject will be given Chance to attend in Re-Test and will be promoted of the 2nd year after passing in those subjects.</li>\r\n<li>The Test Examination will be held on two papers of respective subjects and result will be published according to the procedure of the Board.</li>\r\n</ul>\r\n<hr />\r\n<h4>Adaptation of unfair means</h4>\r\n<ul style=\"margin-left: 35px;\">\r\n<li>The students accused of adaptation of unfair means must be suspended from the college. Any kind of recommendation or persuasion is prohibited to influence the result.</li>\r\n</ul>\r\n<hr />\r\n<h4>Management of the Guide teachers</h4>\r\n<ul style=\"margin-left: 35px;\">\r\n<li>Some particular students will belong to every teacher, the guide teachers will keep record of the attendance, conduct academic development, result preservation and observation of the individual student. The guide teacher will inform the principal and the guardians regarding the particulars of those students. The guardians regarding the particulars of those students. The main objective of this program is to build up a disciplined and so on.</li>\r\n</ul>\r\n<hr />\r\n<h4>Honorable Guardians</h4>\r\n<ul style=\"margin-left: 35px;\">\r\n<li>The respective guardians are requested to communicate with the guardian-teacher conference on the due date .The necessary steps along with preventive measures must be taken by the honorable guardians for requested to supervise the progress of their daughters.</li>\r\n</ul>\r\n</div>', NULL, 'assets/images/default/featured.png', 1, 1, NULL, '2020-09-09 21:01:49'),
(6, 'rules-regulations', 'Rules and Regulations for the students', NULL, NULL, 'assets/images/default/featured.png', 1, 1, NULL, NULL),
(7, 'eligibility', 'Eligibility', '<div class=\"rules_regulation justify\">\r\n<ul>\r\n<li>In each academic year, fresh admission takes place only in Nursery and Cl - XI. Admission in other classes depends on vacant seats.</li>\r\n<li>Admission Test or Merit whichever is applicable conducted through Board of Teachers. Finally the result is approved by the Chairman, Governing Body.</li>\r\n<li>Priority gets Army Ward, thereafter the Civil Ward.</li>\r\n<li>Due to parents&rsquo; transfer, students of any public School &amp; College can get admission in this institution at any time.</li>\r\n<li>If any student takes TC from this institution, one will not be eligible to get admission again without being processed like a fresh case.</li>\r\n</ul>\r\n</div>', NULL, 'assets/images/default/featured.png', 1, 1, NULL, '2020-09-09 21:02:25'),
(8, 'dress-code', 'Dress Code', NULL, NULL, 'assets/images/default/featured.png', 1, 1, NULL, NULL),
(9, 'how-to-apply', 'How To Bkash or Rocket Payment', '<p class=\"news_details\"><object data=\"/assets/uploads/blog/files/1/how_to_bkash.pdf\" width=\"100%\" height=\"600px\">\r\n                                    <iframe src=\"https://docs.google.com/gview?url=http://cbmc.edu.bd/assets/uploads/blog/files/1/how_to_bkash.pdf&amp;embedded=true\" style=\"width: 100%; height: 500px;\" frameborder=\"0\"></iframe>\r\n                                </object></p>\r\n<p><br /><br /><a class=\"btn btn-success\" href=\"/assets/uploads/blog/files/1/how_to_bkash.pdf\" download=\"\">Click here to Download</a> <br /><br /></p>', NULL, 'assets/uploads/pages/1607407764.jpg', 1, 1, NULL, '2020-12-08 18:09:24'),
